import React from 'react'

const CurrencyConvertor = () => {
  return (
    <div id="box">
        <h1>Currency Convertor</h1>
        <div id="divInput"><label>Enter Amount</label><input type="number"/></div>
        <div id="divCurrency"><div><label>From</label><select></select></div><i className="fa-solid fa-arrow-right-arrow-left"></i><div><label>To</label><select></select></div></div>
        <p id="paraAnswer"></p>
        <button id="btnExchange">Get Exchange Rate</button>
    </div>
  )
}

export default CurrencyConvertor
